import{f as a}from"./app.095e7254.js";import{_ as r}from"./plugin-vue_export-helper.21dcd24c.js";const e={},t=a('<p>\u5DE5\u4F5C\u5BA4\u6CA1\u6709\u592A\u591A\u7684\u8981\u6C42\uFF0C\u76F8\u5173\u4FE1\u606F\u5DF2\u7ECF\u5728\u4E0B\u65B9\u8BE6\u7EC6\u5217\u51FA\u3002</p><h2 id="\u4E0D\u9700\u8981" tabindex="-1"><a class="header-anchor" href="#\u4E0D\u9700\u8981" aria-hidden="true">#</a> \u4E0D\u9700\u8981</h2><h3 id="\u76F8\u5173\u5DE5\u4F5C\u7ECF\u9A8C" tabindex="-1"><a class="header-anchor" href="#\u76F8\u5173\u5DE5\u4F5C\u7ECF\u9A8C" aria-hidden="true">#</a> \u76F8\u5173\u5DE5\u4F5C\u7ECF\u9A8C \u274C</h3><p>\u6211\u4EEC\u63A5\u53D7<strong>\u96F6\u5DE5\u4F5C\u7ECF\u9A8C</strong> \u2705 \u7684\u540C\u5B66</p><h3 id="\u5C31\u8BFB-it-\u76F8\u5173\u4E13\u4E1A" tabindex="-1"><a class="header-anchor" href="#\u5C31\u8BFB-it-\u76F8\u5173\u4E13\u4E1A" aria-hidden="true">#</a> \u5C31\u8BFB IT \u76F8\u5173\u4E13\u4E1A \u274C</h3><p>\u6211\u4EEC\u63A5\u53D7<strong>\u4EFB\u4F55\u4E13\u4E1A</strong> \u2705 \u7684\u540C\u5B66\u3002\u53EA\u8981\u60A8\u6709\u5174\u8DA3\u6216\u8005\u6709\u610F\u5411\u4ECE\u4E8B\u76F8\u5173\u9886\u57DF\u5DE5\u4F5C\uFF0C\u6B22\u8FCE\u62A5\u540D\u3002</p><h3 id="\u5927\u4E00\u6216\u7814\u4E00\u65B0\u751F" tabindex="-1"><a class="header-anchor" href="#\u5927\u4E00\u6216\u7814\u4E00\u65B0\u751F" aria-hidden="true">#</a> \u5927\u4E00\u6216\u7814\u4E00\u65B0\u751F \u274C</h3><p>\u6211\u4EEC\u63A5\u53D7\u672C\u79D1\u3001\u7855\u58EB<strong>\u6240\u6709\u975E\u6BD5\u4E1A\u5E74\u7EA7</strong> \u2705 \u7684\u540C\u5B66 (\u6BD5\u4E1A\u5E74\u7EA7\u7684\u4EBA\u9700\u8981\u4E00\u5B9A\u57FA\u7840)</p><h3 id="\u7F34\u7EB3\u57F9\u8BAD\u8D39\u7528" tabindex="-1"><a class="header-anchor" href="#\u7F34\u7EB3\u57F9\u8BAD\u8D39\u7528" aria-hidden="true">#</a> \u7F34\u7EB3\u57F9\u8BAD\u8D39\u7528 \u274C</h3><p>\u6211\u4EEC\u4E49\u52A1\u5BF9\u65B0\u52A0\u5165\u7684\u540C\u5B66\u8FDB\u884C<strong>\u514D\u8D39\u57F9\u8BAD</strong> \u2705</p><p>(<s>\u5F53\u7136\u6211\u4EEC\u4E5F\u4E0D\u662F\u514D\u8D39\u57F9\u8BAD\u73ED\uFF0C\u57F9\u8BAD\u5B8C\u5C31\u8DD1\u8DEF\u751A\u81F3\u8DF3\u69FD\u7684\u8BF7\u60A8\u5F53\u4E2A\u4EBA\u5427</s>)</p><h3 id="\u719F\u7EC3\u638C\u63E1\u7535\u8111\u4F7F\u7528" tabindex="-1"><a class="header-anchor" href="#\u719F\u7EC3\u638C\u63E1\u7535\u8111\u4F7F\u7528" aria-hidden="true">#</a> \u719F\u7EC3\u638C\u63E1\u7535\u8111\u4F7F\u7528 \u274C</h3><p>\u6211\u4EEC\u63A5\u53D7<strong>\u7535\u8111\u5C0F\u767D</strong> \u2705</p><p>\u53EA\u8981\u60A8\u80FD\u591F\u6309\u65F6\u5B8C\u6210\u76F8\u5173\u5185\u5BB9\u7684\u5B66\u4E60\u8981\u6C42\uFF0C\u52AA\u529B\u8865\u8DB3\u77E5\u8BC6\u6C34\u5E73\uFF0C\u8FD9\u90FD\u4E0D\u662F\u95EE\u9898</p><h3 id="\u9884\u5148\u81EA\u5B66\u5E76\u638C\u63E1\u7279\u5B9A\u7F16\u7A0B\u8BED\u8A00" tabindex="-1"><a class="header-anchor" href="#\u9884\u5148\u81EA\u5B66\u5E76\u638C\u63E1\u7279\u5B9A\u7F16\u7A0B\u8BED\u8A00" aria-hidden="true">#</a> \u9884\u5148\u81EA\u5B66\u5E76\u638C\u63E1\u7279\u5B9A\u7F16\u7A0B\u8BED\u8A00 \u274C</h3><p>\u60A8\u65E0\u9700\u7F16\u7A0B\u8BED\u8A00\u57FA\u7840 \u2705</p><h3 id="\u7CFB\u7EDF\u5B66\u4E60\u7F8E\u672F\u6216\u638C\u63E1\u8BBE\u8BA1\u6280\u5DE7" tabindex="-1"><a class="header-anchor" href="#\u7CFB\u7EDF\u5B66\u4E60\u7F8E\u672F\u6216\u638C\u63E1\u8BBE\u8BA1\u6280\u5DE7" aria-hidden="true">#</a> \u7CFB\u7EDF\u5B66\u4E60\u7F8E\u672F\u6216\u638C\u63E1\u8BBE\u8BA1\u6280\u5DE7 \u274C</h3><p>\u60A8\u65E0\u9700\u8BBE\u8BA1\u57FA\u7840 \u2705</p><h3 id="\u9884\u5148\u638C\u63E1-ps\u3001ai\u3001sketch-\u7B49\u8F6F\u4EF6" tabindex="-1"><a class="header-anchor" href="#\u9884\u5148\u638C\u63E1-ps\u3001ai\u3001sketch-\u7B49\u8F6F\u4EF6" aria-hidden="true">#</a> \u9884\u5148\u638C\u63E1 PS\u3001AI\u3001Sketch \u7B49\u8F6F\u4EF6 \u274C</h3><p>\u60A8\u65E0\u9700\u638C\u63E1\u8BBE\u8BA1\u8F6F\u4EF6 \u2705</p><h3 id="\u9884\u5148\u638C\u63E1\u7F51\u9875\u76F8\u5173\u652F\u6301" tabindex="-1"><a class="header-anchor" href="#\u9884\u5148\u638C\u63E1\u7F51\u9875\u76F8\u5173\u652F\u6301" aria-hidden="true">#</a> \u9884\u5148\u638C\u63E1\u7F51\u9875\u76F8\u5173\u652F\u6301 \u274C</h3><p>\u60A8\u65E0\u9700\u638C\u63E1\u7F51\u9875\u57FA\u7840 \u2705</p><h2 id="\u60A8\u9700\u8981" tabindex="-1"><a class="header-anchor" href="#\u60A8\u9700\u8981" aria-hidden="true">#</a> \u60A8\u9700\u8981</h2><h3 id="\u4E00\u53F0\u8FBE\u5230\u57FA\u672C\u914D\u7F6E\u6C34\u5E73\u7684\u7535\u8111" tabindex="-1"><a class="header-anchor" href="#\u4E00\u53F0\u8FBE\u5230\u57FA\u672C\u914D\u7F6E\u6C34\u5E73\u7684\u7535\u8111" aria-hidden="true">#</a> \u4E00\u53F0\u8FBE\u5230\u57FA\u672C\u914D\u7F6E\u6C34\u5E73\u7684\u7535\u8111 \u26A0\uFE0F</h3><p>\u5F00\u53D1\u9700\u8981\u5728\u7535\u8111\u4E0A\u8FDB\u884C\uFF0C\u800C\u4E14\u9700\u8981<strong>\u8FBE\u5230\u7B14\u8BB0\u672C\u7684\u5E73\u5747\u6027\u80FD\u6C34\u5E73</strong>\uFF0C\u5426\u5219\u65E0\u6CD5\u6D41\u7545\u8FD0\u884C\u7279\u5B9A\u5F00\u53D1\u73AF\u5883\u3002</p><h3 id="\u6709\u76F8\u5173\u5174\u8DA3\u7231\u597D" tabindex="-1"><a class="header-anchor" href="#\u6709\u76F8\u5173\u5174\u8DA3\u7231\u597D" aria-hidden="true">#</a> \u6709\u76F8\u5173\u5174\u8DA3\u7231\u597D \u26A0\uFE0F</h3><p>\u8BF7\u4EE5<strong>\u5174\u8DA3\u7231\u597D\u6216\u65E5\u540E\u5DE5\u4F5C</strong>\u4E3A\u4E3B\u62A5\u540D\u52A0\u5165\u3002</p><div class="custom-container tip"><p class="custom-container-title">\u63D0\u793A</p><p>\u5982\u679C\u60A8\u5BF9\u5F00\u53D1\u4E0D\u592A\u611F\u5174\u8DA3\uFF0C\u4E5F\u4E0D\u6253\u7B97\u4ECE\u4E8B\u76F8\u5173\u5DE5\u4F5C\uFF0C\u8BF7\u60A8\u614E\u91CD\u8003\u8651\u52A0\u5165\uFF0C\u56E0\u4E3A\u8FD9\u79CD\u60C5\u51B5\u4E0B\u5DE5\u4F5C\u5BA4\u65E0\u6CD5\u7ED9\u60A8\u5E26\u6765\u5339\u914D\u7684\u56DE\u62A5\u3002</p><p>\u771F\u8BDA\u63D0\u793A\u60A8: \u4E0D\u5FC5\u82B1\u8D39\u5927\u534A\u5E74\u5B66\u4E60\u4E00\u4E2A\u4E0D\u611F\u5174\u8DA3\uFF0C\u6BD5\u4E1A\u540E\u4E0D\u4F1A\u4F7F\u7528\u7684\u6280\u80FD\u3002</p></div><h3 id="\u81EA\u5F8B\u3001\u81EA\u89C9" tabindex="-1"><a class="header-anchor" href="#\u81EA\u5F8B\u3001\u81EA\u89C9" aria-hidden="true">#</a> \u81EA\u5F8B\u3001\u81EA\u89C9 \u26A0\uFE0F</h3><p>\u5728\u5B66\u4E60\u9636\u6BB5\u6211\u4EEC\u91C7\u53D6\u9053\u5C14\u987F\u5236\u6559\u5B66\u65B9\u5F0F\uFF0C\u5728\u5DE5\u4F5C\u9636\u6BB5\u5DE5\u4F5C\u5BA4\u4EFB\u52A1\u6309\u5468\u5206\u914D\uFF0C\u8BF7<strong>\u81EA\u4E3B\u5B66\u4E60\u3001\u5DE5\u4F5C</strong>\u3002</p><div class="custom-container warning"><p class="custom-container-title">\u6CE8\u610F</p><p>\u5DE5\u4F5C\u5BA4\u4E0D\u4F1A\u6210\u5929\u62CE\u7740\u60A8\u7684\u8033\u6735\u558A\u60A8\u5B66\u4E60\u6216\u5DE5\u4F5C\u3002</p><p>\u6240\u4EE5\u5982\u679C\u60A8\u201C\u4E0D\u81EA\u5F8B\u4E0D\u81EA\u89C9\uFF0C\u52A8\u4E0D\u52A8\u5C31\u5FD8\u4E86\u5B66\u201D\uFF0C\u8BF7\u4E0D\u8981\u62A5\u540D\u3002</p></div><h3 id="\u6709\u4E00\u5B9A\u7A7A\u95F2\u65F6\u95F4\u5E76\u5177\u5907\u65F6\u95F4\u7BA1\u7406\u80FD\u529B" tabindex="-1"><a class="header-anchor" href="#\u6709\u4E00\u5B9A\u7A7A\u95F2\u65F6\u95F4\u5E76\u5177\u5907\u65F6\u95F4\u7BA1\u7406\u80FD\u529B" aria-hidden="true">#</a> \u6709\u4E00\u5B9A\u7A7A\u95F2\u65F6\u95F4\u5E76\u5177\u5907\u65F6\u95F4\u7BA1\u7406\u80FD\u529B \u26A0\uFE0F</h3><p>\u5076\u5C14\u4E8B\u52A1\u7F20\u8EAB\u662F\u5F88\u6B63\u5E38\u7684\uFF0C\u4F46\u662F\u5728\u5927\u591A\u6570\u60C5\u51B5\u4E0B\uFF0C\u5E94\u5F53<strong>\u80FD\u591F\u5B89\u6392\u51FA\u65F6\u95F4</strong>\u3002</p><div class="custom-container tip"><p class="custom-container-title">\u63D0\u793A</p><p>\u5DE5\u4F5C\u5BA4\u63A8\u8350\u6BCF\u5468\u5206\u914D 10 - 15 \u5C0F\u65F6\u6295\u5165\u5230\u5B66\u4E60\u548C\u5DE5\u4F5C\u4E2D\u6765\uFF0C\u6700\u4F4E\u4E0D\u5E94\u4F4E\u4E8E 8 \u5C0F\u65F6\u3002</p><ul><li>\u5982\u679C\u60A8\u56E0\u53C2\u4E0E\u6570\u4E2A\u5176\u4ED6\u7EC4\u7EC7\u3001\u793E\u56E2\u6BD4\u8F83\u5FD9\u788C\uFF0C\u8BF7\u914C\u60C5\u9009\u62E9\u9000\u51FA\u5B83\u4EEC\u3002</li><li>\u5982\u679C\u60A8\u5DF2\u7ECF\u6709\u79D1\u7814\u9879\u76EE\uFF0C\u8BF7\u614E\u91CD\u8003\u8651\u60A8\u7684\u7CBE\u529B\u3002</li><li>\u5982\u679C\u60A8\u4E13\u4E1A\u8BFE\u9047\u5230\u56F0\u96BE\u3001\u5B66\u4E60\u5403\u529B\uFF0C\u8BF7\u60A8\u7262\u8BB0\u5B66\u4E60\u624D\u662F\u5927\u5B66\u751F\u7684\u7B2C\u4E00\u8981\u52A1\u3002</li></ul><p>\u6B64\u5916\uFF0C\u5DE5\u4F5C\u5BA4\u5728\u671F\u4E2D\u8003\u8BD5\u524D\u3001\u671F\u672B\u590D\u4E60\u5468\u5E76\u4E0D\u4F1A\u5B89\u6392\u4EFB\u4F55\u5185\u5BB9\u3002</p></div><h3 id="\u7EC4\u7EC7\u6027" tabindex="-1"><a class="header-anchor" href="#\u7EC4\u7EC7\u6027" aria-hidden="true">#</a> \u7EC4\u7EC7\u6027 \u26A0\uFE0F</h3><p>\u5DE5\u4F5C\u5BA4\u4F1A\u5C3D\u53EF\u80FD\u534F\u8C03\u65F6\u95F4\uFF0C\u4E5F\u4E0D\u4F1A\u5F3A\u5236\u5927\u5BB6\u53C2\u52A0\u4EFB\u4F55\u5185\u5BB9\u3002\u6709\u4E8B\u60C5\u8BF7<strong>\u63D0\u524D\u8BF7\u5047</strong>\u3002</p><p>\u5DE5\u4F5C\u5BA4\u4F1A\u8BE2\u95EE\u5927\u5BB6\u8FD1\u671F\u5B89\u6392\uFF0C\u5E76\u5145\u5206\u8003\u8651\u5927\u5BB6\u60C5\u51B5\u5E03\u7F6E\u4EFB\u52A1\uFF0C\u8BF7<strong>\u6309\u65F6\u5B8C\u6210\u5E03\u7F6E\u7684\u4EFB\u52A1</strong>\uFF0C\u672A\u6309\u65F6\u5B8C\u6210\u8BF7\u5C3D\u65E9\u8BF4\u660E\u60C5\u51B5\u3002</p><div class="custom-container warning"><p class="custom-container-title">\u6CE8\u610F</p><p>\u5C3D\u7BA1\u5DE5\u4F5C\u5BA4\u63D0\u4F9B\u4F1A\u8BAE\u5F55\u50CF\u56DE\u653E\uFF0C\u4F46\u5F88\u591A\u9879\u76EE\u9700\u8981\u5927\u5BB6\u53C2\u4E0E\u63A2\u8BA8\u3001\u534F\u4F5C\u5B8C\u6210\u3002</p><p><strong>\u65E0\u6545\u7F3A\u5E2D\u3001\u65E0\u6545\u62D6\u5EF6</strong>\u662F\u5DE5\u4F5C\u5BA4\u65E0\u6CD5\u63A5\u53D7\u7684\uFF0C\u56E0\u4E3A\u8FD9\u4F1A\u6253\u4E71\u9879\u76EE\u5B89\u6392\u4E0E\u6574\u4E2A\u5DE5\u671F\u8FDB\u5EA6\u3002</p></div><h3 id="\u4E00\u5B9A\u6C34\u5E73\u7684\u81EA\u5B66\u80FD\u529B" tabindex="-1"><a class="header-anchor" href="#\u4E00\u5B9A\u6C34\u5E73\u7684\u81EA\u5B66\u80FD\u529B" aria-hidden="true">#</a> \u4E00\u5B9A\u6C34\u5E73\u7684\u81EA\u5B66\u80FD\u529B \u26A0\uFE0F</h3><p>\u60A8\u9700\u8981\u6709<strong>\u901A\u8FC7\u6587\u6863\u4E0E\u89C6\u9891\u8FDB\u884C\u5B66\u4E60</strong>\u7684\u57FA\u7840\u80FD\u529B\u3002</p><div class="custom-container tip"><p class="custom-container-title">\u63D0\u793A</p><p>\u5DE5\u4F5C\u5BA4\u7684\u5B66\u4E60\u6A21\u5F0F\u4E3A\u201C\u6839\u636E\u6750\u6599\u81EA\u5B66 + \u9636\u6BB5\u6027\u4E00\u5BF9\u4E00\u68B3\u7406\u8BB2\u89E3\u201D\u3002</p><p>\u4E5F\u5C31\u662F\u8BF4\u5DE5\u4F5C\u5BA4\u4F1A\u7ED9\u60A8\u8BE6\u7EC6\u7684\u5B66\u4E60\u6750\u6599\u4E0E\u5B66\u4E60\u5B89\u6392\uFF0C\u8BA9\u60A8\u81EA\u4E3B\u5B66\u4E60\uFF0C\u540C\u65F6\u6BCF\u5929\u89E3\u7B54\u60A8\u5B66\u4E60\u8FC7\u7A0B\u4E2D\u9047\u5230\u5E76\u63D0\u51FA\u7684\u7591\u95EE\u3002</p><p>\u540C\u65F6\u5DE5\u4F5C\u5BA4\u4F1A\u5B9A\u671F\u5B89\u6392\u65F6\u95F4\u4E00\u5BF9\u4E00\u8FDB\u884C\u9636\u6BB5\u6027\u68B3\u7406\u4E0E\u96BE\u70B9\u8BB2\u89E3\uFF0C\u5E2E\u52A9\u60A8\u9A8C\u8BC1\u60A8\u7684\u81EA\u5B66\u6210\u679C\u5E76\u5EA6\u8FC7\u5B66\u4E60\u4E0A\u7684\u96BE\u70B9\u3002</p><p>\u4F46\u8BF7<strong>\u4E0D\u8981</strong>\u6307\u671B\u6240\u6709\u5185\u5BB9\u5747\u4F1A\u5F00\u5C55<strong>\u4E00\u5BF9\u4E00\u6559\u5B66</strong>\u3002</p></div><h3 id="\u4E00\u5B9A\u6C34\u5E73\u7684\u82F1\u8BED\u80FD\u529B" tabindex="-1"><a class="header-anchor" href="#\u4E00\u5B9A\u6C34\u5E73\u7684\u82F1\u8BED\u80FD\u529B" aria-hidden="true">#</a> \u4E00\u5B9A\u6C34\u5E73\u7684\u82F1\u8BED\u80FD\u529B \u26A0\uFE0F</h3><p>\u5F88\u591A\u5B98\u65B9\u6587\u6863\u53EA\u6709\u82F1\u6587\u7248\u672C\uFF0C\u5728\u5F00\u53D1\u4E2D\u4E5F\u662F\u4F7F\u7528\u82F1\u6587\u800C\u4E0D\u662F\u6C49\u5B57\u6765\u8FDB\u884C\u7F16\u7A0B\u6216\u5F00\u53D1\u3002\u6240\u4EE5\u60A8\u9700\u8981<strong>\u5177\u5907\u82F1\u6587\u6587\u6863\u9605\u8BFB\u80FD\u529B</strong>\u3002</p><div class="custom-container tip"><p class="custom-container-title">\u63D0\u793A</p><p>\u5DE5\u4F5C\u5BA4\u663E\u7136\u6CA1\u6709\u7CBE\u529B\u4E3A\u65B0\u6210\u5458\u7FFB\u8BD1\u6BCF\u4E00\u4EFD\u82F1\u6587\u6750\u6599\uFF0C\u53EA\u80FD\u5C3D\u91CF\u63D0\u4F9B\u4E2D\u6587\u6587\u6863\u3002</p><p>\u5982\u679C\u60A8\u65E0\u6CD5\u9605\u8BFB\u82F1\u6587\u6587\u6863\uFF0C\u4E5F\u4E0D\u80FD\u501F\u52A9\u8C37\u6B4C\u7FFB\u8BD1\u4E0E\u5B57\u5178\u201C\u51D1\u5408\u201D\u770B\uFF0C\u8BF7\u4E0D\u8981\u62A5\u540D\u3002</p></div><h3 id="\u76F8\u5173\u80FD\u529B" tabindex="-1"><a class="header-anchor" href="#\u76F8\u5173\u80FD\u529B" aria-hidden="true">#</a> \u76F8\u5173\u80FD\u529B \u203C</h3><ul><li><strong>\u4EA7\u54C1\u8BBE\u8BA1</strong>: \u4E00\u5B9A\u7684\u5BA1\u7F8E\u80FD\u529B</li><li><strong>\u5176\u4ED6\u65B9\u5411</strong>: \u4E00\u5B9A\u7684\u903B\u8F91\u80FD\u529B</li></ul><p>\u8BBE\u8BA1\u5E08\u9700\u8981<strong>\u57FA\u7840\u7684\u5BA1\u7F8E</strong>\uFF0C\u5982\u679C\u60A8\u7684\u5BA1\u7F8E\u6807\u51C6\u548C\u4ED6\u4EBA\u6709\u8F83\u5927\u5DEE\u5F02\uFF0C\u8BF7\u52FF\u62A5\u540D\u4EA7\u54C1\u8BBE\u8BA1\u3002</p><p>\u540C\u6837\uFF0C\u903B\u8F91\u80FD\u529B\u662F\u7ED9\u51FA<strong>\u6B63\u786E\u7A0B\u5E8F\u8BBE\u8BA1\u601D\u8DEF</strong>\u5FC5\u4E0D\u53EF\u5C11\u7684\u9700\u6C42\u3002\u5982\u679C\u9AD8\u4E2D\u7684\u6570\u5B66\u548C\u7269\u7406\u63A8\u5BFC\u5BF9\u4E8E\u60A8\u6765\u8BF4\u662F\u5F88\u5934\u75BC\u7684\u4E8B\u60C5\uFF0C\u771F\u8BDA\u5EFA\u8BAE\u60A8\u614E\u91CD\u8003\u8651\u3002</p>',48);function n(i,s){return t}var o=r(e,[["render",n],["__file","need.html.vue"]]);export{o as default};
